import reacticon from "../assets/img/icon/reacticon.png";
import sassicon from "../assets/img/icon/sassicon.png";
import { Col, Container, Row } from "react-bootstrap";
import img1 from "../assets/img/Baymish/Risorsa 1-100.jpg";
import img2 from "../assets/img/Baymish/Risorsa 2-100.jpg";
import img3 from "../assets/img/Baymish/Risorsa 3-100.jpg";

function BaymishProject() {
  return (
    <>
      <Row className="d-flex  align-items-center ">
        <h2 className="myTextWhite d-flex fw-bolder justify-content-center my-4">
          My Projects:
        </h2>
        <h5 className="myTextRed d-flex fw-bolder justify-content-center">
          {" "}
          Grafic Design{" "}
        </h5>{" "}
        <Col lg={9} className=" d-flex align-items-center flex-column">
          <h3> carosello</h3>
          <div className="contenut">
            <div className="carousel">
              <article className="card">
                <h3>ciao</h3>{" "}
              </article>
              <article className="card"> </article>
              <article className="card"> </article>
            </div>
          </div>
        </Col>
        <Col className=" d-flex align-items-center justify-content-center flex-m-flex "></Col>
      </Row>
    </>
  );
}

export default BaymishProject;
